import React from 'react';
import ReactDOM from 'react-dom';
import { View, Panel, PanelHeader, Epic, Tabbar, TabbarItem } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

class App extends React.Component {

render() {
  return (
    <View>
        <Epic>
          </Epic>
      </View>
  )
}
}
 export default App;
